import React from "react";
import { Link } from "react-router-dom";

import "./styles.css";

const logoImg = require("../../assets/images/logo.svg");
const backIcon = require("../../assets/images/icons/back.svg");
const whatsappIcon = require("../../assets/images/icons/whatsapp.svg");

interface PageheaderProps {
	title: string;
}

const PageHeader: React.FC<PageheaderProps> = (props) => {
	return (
		<header className="page-header">
			<div className="top-bar-container">
				<Link to="./">
					<img src={backIcon} alt="Voltar" />
				</Link>
				<img src={logoImg} alt="Proffy" />
			</div>
			<div className="header-content">
				<strong>{props.title}</strong>
				{props.children}
			</div>
			<main>
				<article className="teachers-item">
					<header>
						<img
							src="https://avatars1.githubusercontent.com/u/17464462?s=460&u=8d9295b72a7abe4f087e652970138d8cdc93c958&v=4"
							alt="Foto de perfil"
						/>
						<div>
							<strong>Maurício Soares</strong>
							<span>Química</span>
							<p>
								Entusiasta das melhores tecnologias de química avançada.
								<br />
								<br />
								Apaixonado por explodir coisas em laboratório e por mudar a vida
								das pessoas através de experiiencias. Mais de 200.00 já passaram
								por umas das minhas explosões.
							</p>
						</div>

						<footer>
							<p>
								Preço/hora
								<strong>R$ 80,00</strong>
								<img src={whatsappIcon} alt="whatsapp" />
							</p>
						</footer>
					</header>
				</article>
			</main>
		</header>
	);
};

export default PageHeader;
